import React from 'react';
import './index.css';
const Form = () => {
  return(
   <>
   <h1>hello guys</h1>
   <h1>this is form section</h1>
      <input type="text" /> 
      <input type="email" />
      <input type="password" />
   
  </>
  );
};

export default Form;
